INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3085, '2017-04-19 13:52:06', '00:02:03', 'Thomas Rath präsentiert seinen ersten Nagellack', 'In Düsseldorf dreht sich derzeit alles um das Thema Schönheit. Drei Tage lang zeigt die Fachmesse
            „Beauty“ die neuesten Trends und Innovationen der Branche. Die Besucher können sich dabei im wahrsten Sinne
            des Wortes von oben bis unten informieren.

