INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3086, '2017-04-19 13:52:14', '00:02:12', 'Das Geheimnis der Barbara Schöneberger', 'Schönheit und tolle Looks - beinahe um nichts anderes ging es drei Tage lang auf dem Messegelände
            in Düsseldorf. Beauty, TopHair und Make-Up-Artist-Design heißt das Fachveranstaltungstrio, auf dem Profis
            sich weiterbilden, Neuheiten entdecken und Vertriebswege suchen. Denn auch wenn Schönheit von innen kommt,
            ist das Äußere ein großes Wirtschaftsfeld. Und eins ist auf jeden Fall neu: Wer schön sein will, muss nicht
            mehr leiden. Wohlfühlen ist das Geheimnis - zumindest von Barbara Schöneberger.
        ', '2017-04-03', 'M4-TV', 'http://vod.gcdn.eu/3086/_picture.jpg', 'http://vod.gcdn.eu/3086/v240.mp4', 'http://vod.gcdn.eu/3086/v360.mp4', 'http://vod.gcdn.eu/3086/v480.mp4', 'http://vod.gcdn.eu/3086/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:7:"DE-News";}', 0, '2017-08-12 17:13:19');
INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3087, '2017-04-19 13:52:20', '00:01:56', 'Massage deluxe und entspannende Anwendungen', 'Etwa die Hälfte der Menschen in Deutschland nutzen professionelle, kosmetische Behandlungen. Wer
