INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3925, '2017-05-15 11:49:37', '00:01:44', 'Save Food - Kampf gegen den Hunger', 'Inzwischen ist es in den Köpfen der meisten Menschen dieser Welt - Überfluss und
            Verschwendung sind gerade bei Lebensmitteln kein Wohlstandsmerkmal sondern ein
