INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3936, '2017-05-15 16:50:32', '00:01:01', 'ALL EYEZ ON ME Trailer I', 'Für die einen ist er die Hip-Hop-Legende schlechthin, der 75 Millionen Alben weltweit verkaufte,
            einen Hit („Changes“, „California Love“, „Dear Mama“) nach dem anderen landete und eine sozialkritische
            Stimme hatte, nach deren Macht die Leute verlangten. Für die anderen ist er der kriminelle Rapper, der knapp
            ein Jahr seines sehr kurzen Lebens im Knast saß: Tupac Amaru Shakur alias 2Pac! Am 15. Juni 2017 kommt
            endlich ein Film über sein Leben in die deutschen Kinos.

            (© 2017 Constantin Film Verleih GmbH)
        ', '2017-05-15', '2017 Constantin Film Verleih GmbH', 'http://vod.gcdn.eu/3936/_picture.jpg', 'http://vod.gcdn.eu/3936/v240.mp4', 'http://vod.gcdn.eu/3936/v360.mp4', 'http://vod.gcdn.eu/3936/v480.mp4', 'http://vod.gcdn.eu/3936/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:15:"Filme / Trailer";}', 0, '2017-08-12 17:13:19');
INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3937, '2017-05-15 16:50:37', '00:02:18', 'ALL EYEZ ON ME Trailer II', 'ALL EYEZ ON ME erzählt die Geschichte von Tupac Shakur (Demetrius Shipp Jr.) und seinem Leben
            voller Ruhm, Glück, Konflikten und Gewalt. Aufgewachsen in den Straßen New Yorks und hineingeworfen in eine
            Welt aus Ungerechtigkeit und Willkür, beobachtet er, wie seine Community an Drogen zerbricht und von einer
            brutalen Polizeimacht unterdrückt wird. Schon früh experimentiert er mit Rap, um seiner Realität als junger
            schwarzer Mann eine Stimme zu geben. Sein Erfolg und plötzliche Berühmtheit werden aber gleichzeitig auch
            sein Untergang sein: Immer wieder gerät er mit dem Gesetz in Konflikt. 1995 muss er erneut ins Gefängnis.
            Als er nach seiner Entlassung zu Death Row Records geht und das Doppelalbum „All Eyez on me“ veröffentlicht,
            wird 2Pac zu einem der beliebtesten Rapper auf dem Planeten. Am 7. September 1996 wird er in Las Vegas auf
            offener Straße angeschossen. Sechs Tage später stirbt er mit nur 25 Jahren.

            (© 2017 Constantin Film Verleih GmbH)
        ', '2017-05-14', '2017 Constantin Film Verleih GmbH', 'http://vod.gcdn.eu/3937/_picture.jpg', 'http://vod.gcdn.eu/3937/v240.mp4', 'http://vod.gcdn.eu/3937/v360.mp4', 'http://vod.gcdn.eu/3937/v480.mp4', 'http://vod.gcdn.eu/3937/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:15:"Filme / Trailer";}', 0, '2017-08-12 17:13:19');
INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3938, '2017-05-15 16:50:41', '00:01:41', 'Jugend ohne Gott', 'In der digitalisierten Gesellschaft der Zukunft spielen Liebe, Moral und Menschlichkeit nur noch
            untergeordnete Rollen. Alles ist auf Leistung, Anpassung und Effizienz ausgerichtet. Frei nach dem
            gleichnamigen Roman von Ödön von Horváth erzählt Regisseur Alain Gsponer (HEIDI, LILA, LILA) in JUGEND OHNE
            GOTT die Geschichte einer Gruppe von Schülern, die als Hoffnungsträger der Leistungsgesellschaft an ihre
            Grenzen stoßen. Jannis Niewöhner brilliert in der Verfilmung des Jugendbuchklassikers in der Rolle als Zach,
            für die er in diesem Jahr mit dem Bayerischen Filmpreis ausgezeichnet wurde. Fahri Yardim, Emilia Schüle,
            Alicia von Rittberg, Jannik Schümann und Anna Maria Mühe runden die hochkarätige Besetzung ab.
            (© 2017 Constantin Film Verleih GmbH)
        ', '2017-05-15', '2017 Constantin Film Verleih GmbH', 'http://vod.gcdn.eu/3938/_picture.jpg', 'http://vod.gcdn.eu/3938/v240.mp4', 'http://vod.gcdn.eu/3938/v360.mp4', 'http://vod.gcdn.eu/3938/v480.mp4', 'http://vod.gcdn.eu/3938/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:15:"Filme / Trailer";}', 0, '2017-08-12 17:13:19');
INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (3939, '2017-05-15 16:50:46', '00:02:39', 'GRIESSNOCKERLAFFÄRE', 'Der Hohepriester der Wurschtigkeit ist wieder da. In GRIESSNOCKERLAFFÄRE wird es wirklich mühsam
            für den bayerischen Dorfbullen Franz Eberhofer, denn diesmal steht er selbst unter Mordverdacht. Bei der
            vierten Verfilmung eines Rita Falk-Bestsellers haben Regisseur Ed Herzog und Erfolgsproduzentin Kerstin
            Schmidbauer erneut das bewährte Niederkaltenkirchener Ensemble versammelt: Neben Sebastian Bezzel und Simon
            Schwarz als Ermittler-Dreamteam spielen auch wieder Lisa Maria Potthoff, Enzi Fuchs, Eisi Gulp, Gerhard
            Wittmann, Sigi Zimmerschied, Daniel Christensen, Stephan Zinner und Max Schmidt mit. Neu im Eberhoferschen
            Kosmos sind Nora Waldstätten als resolute Kommissarin „Thin Lizzy“, Branko Samarovski als Omas lang
            verschollene Jugendliebe sowie Lilith Stangenberg als geheimnisvolle Witwe Barschl. Das schlimmste Drama
            muss Franz allerdings daheim erleiden: Da gibt es neuerdings nur noch Grießnockerlsuppe.

            (© 2017 Constantin Film Verleih GmbH)
        ', '2017-05-15', '2017 Constantin Film Verleih GmbH', 'http://vod.gcdn.eu/3939/_picture.jpg', 'http://vod.gcdn.eu/3939/v240.mp4', 'http://vod.gcdn.eu/3939/v360.mp4', 'http://vod.gcdn.eu/3939/v480.mp4', 'http://vod.gcdn.eu/3939/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:15:"Filme / Trailer";}', 0, '2017-08-12 17:13:19');
