INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (4721, '2017-06-07 13:22:22', '00:02:36', 'DAS PUBERTIER - DER FILM', 'Jan Weiler schrieb 2014 mit dem „Pubertier“ das perfekte Buch für die ganze Familie. Die 22
            hochamüsanten Geschichten über muffelige, maulfaule Pubertierende und ihre nicht minder peinlichen Eltern
            stürmten die „Spiegel“Bestsellerliste und belegten mehrere Monate den ersten Platz. Leander Haußmann
            (SONNENALLEE, HERR LEHMANN) adaptierte den Bestseller nun für die Leinwand. Produzent ist Günter Rohrbach
            (ANONYMA – EINE FRAU IN BERLIN, DIE WEISSE MASSAI, AIMEE & JAGUAR, SCHTONK, DAS BOOT). In den
            Hauptrollen spielen Jan Josef Liefers, Heike Makatsch, Detlev Buck, Monika Gruber, Justus von Dohnányi und
            die 13-jährige Newcomerin Harriet Herbig-Matten als Pubertier.

            (© 2017 Constantin Film Verleih GmbH)
        ', '2017-06-07', '© 2017 Constantin Film Verleih GmbH', 'http://vod.gcdn.eu/4721/_picture.jpg', 'http://vod.gcdn.eu/4721/v240.mp4', 'http://vod.gcdn.eu/4721/v360.mp4', 'http://vod.gcdn.eu/4721/v480.mp4', 'http://vod.gcdn.eu/4721/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:15:"Filme / Trailer";}', 0, '2017-08-12 17:13:19');
