        ', '2017-06-15', 'M4-TV', 'http://vod.gcdn.eu/5132/_picture.jpg', 'http://vod.gcdn.eu/5132/v240.mp4', 'http://vod.gcdn.eu/5132/v360.mp4', 'http://vod.gcdn.eu/5132/v480.mp4', 'http://vod.gcdn.eu/5132/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:5:"Reise";}', 0, '2017-08-12 17:13:19');
