INSERT INTO dmwd.videos (xml_id, released, duration, title, description, date, author, picture, video_240p, video_360p, video_480p, video_720p, keywords, categories, blacklist, created_at) VALUES (5240, '2017-06-22 16:38:50', '00:01:04', 'Darkland', 'Zaid (Dar Salim), ein erfolgreicher Chirurg, hat ein erfülltes Leben und wohnt zusammen mit seiner
            hochschwangeren Frau Stine (Stine Fischer Christensen) in einer schicken Wohnung. Eines Nachts klopft sein
            jüngerer Bruder Yasin an der Tür und bittet Zaid um Geld – doch er weigert sich ihm zu helfen. Ein paar Tage
            später wird Yasin tot aufgefunden. Da die Polizei sich nicht sehr kooperativ gibt, fühlt sich Zaid
            gezwungen, selbst herauszufinden, wer seinen Bruder auf so brutale Art umgebracht hat und begibt sich auf
            eine Mission in die Unterwelt Kopenhagens, um die kriminelle Bande zu beseitigen. Doch Zaids anhaltender
            Rachezug hat ernsthaften Konsequenzen für ihn und seine Familie, und er muss sich bald entscheiden, wie weit
            er bereit ist zu gehen… (© 2017 Concorde Filmverleih GmbH)
        ', '2017-06-22', '© 2017 Concorde Filmverleih GmbH', 'http://vod.gcdn.eu/5240/_picture.jpg', 'http://vod.gcdn.eu/5240/v240.mp4', 'http://vod.gcdn.eu/5240/v360.mp4', 'http://vod.gcdn.eu/5240/v480.mp4', 'http://vod.gcdn.eu/5240/v720.mp4', 's:0:"";', 'a:1:{s:8:"category";s:15:"Filme / Trailer";}', 0, '2017-08-12 17:13:19');
